  false,\n\t\"url\": null,\n\t\"notes\": \"This Marsh, Water, and Moist Soil Management
  Plan for the Ottawa NWR Complex provides an introduction to the Complex and provides
  background information on Annual Water Management Plans. Water management objectives
  are listed, and consideration is given to habitat and wildlife related to marsh
  management. Habitat enhancement is discussed including rehabilitation of dikes,
  marsh development, farm fields, moist soil, greentree reservoirs, and reforestation.
  A detailed summary of the pool elevation, water control structures, history, wildlife,
  facility improvements, and objectives is provided for each unit in the Complex.\",\n\t\"license_title\":
